import React from 'react'

const Contacto = () => {
  return (
    <div className='page'>
      <h1>Contacto</h1>
      <form className='contact'>
        <input type="text" placeholder='Nombre' required/>
        <input type="email" placeholder='Email' required/>

      </form>
    </div>
  )
}

export default Contacto
